import React from "react";

const BookDetails = (props) => {
  //const {title, author, synopsis}= bookData;
  console.log('book data', props);
  return (
    <main>
      <h1>{props.bookData[0].title}</h1>
      <h1>{props.bookData[0].author}</h1>
      <h1>{props.bookData[0].synopsis}</h1>
    </main>
  );
};

export default BookDetails;
